function fullscreenParallax(){var e=$(window);$(".parallax").each(function(){var t=$(this);var n=t.data("background-speed-x");var r=t.data("background-speed-y");var i=t.data("parallax-align");var s=t.data("parallax-stick-x");var o=t.data("parallax-stick-y");var u=t.data("parallax-offset-x-percent")/100;var a=t.data("parallax-offset-y-percent")/100;var f=t.data("parallax-height")/100;if(n===null||n===undefined){n=0}if(r===null||r===undefined){r=1}if(isNaN(u)){u=0}if(isNaN(a)){a=0}if(isNaN(f)){f=1}var l={};if(r!==1){l["background-attachment"]="fixed"}l["background-size"]="cover";if(t.data("parallax-image")){l["background-image"]="url("+t.data("parallax-image")+")"}t.css(l);e.scroll(function(){var u=0,l=0;var c=e.scrollTop();var h=t.offset().top;var p=false,d=false;var v=e.height()*f;if(n!==0){if(s==="before"){if(c<h){p=true}}else if(s==="after"){if(c>h){p=true}}else{p=true}}if(p){u=(h-c)*n}if(r!==1){if(o==="before"){if(c<h){d=true}}else if(o==="after"){if(c>h){d=true}}else{d=true}}if(d){l=(h-c)*r+v*a}if(i==="bottom"){l+=v}t.css({"background-position":u+"px "+l+"px"})})});$(window).resize(function(){$(".parallax").each(function(){var t=$(this);var n=t.data("parallax-height")/100;if(isNaN(n)){n=1}t.css({height:e.height()*n})});$(window).scroll()});$(window).resize()}